function Events() {
  return (
    <div id="events" className="tabcontent">
      <h1>Upcoming Events</h1>
      <div className="events-gallery">
        <div className="event">
          <img src="/img/touchbass.jpg" alt="Event 1" />
          <p className="event-description">Event 1 Description</p>
        </div>
      </div>
    </div>
  );
}
